import React from 'react';
import ProfileForm from '../components/ProfileForm';
import SocialLinks from '../components/SocialLinks';


function Form() {
  return (
    <div className="flex flex-col items-center min-h-screen bg-gray-800">
      <ProfileForm />
      <SocialLinks />
    </div>
  );
}

export default Form;
